    owner VARCHAR(255)
);

CREATE TABLE music_equipment (
    id INT PRIMARY KEY,
    name TEXT,
    category TEXT,
    quantity INT
);

CREATE TABLE singing_studios (
    id INT PRIMARY KEY,
    name TEXT,
    location TEXT,
    capacity INT
);

CREATE TABLE equipment_assignment (
    studio_id INT,
    equipment_id INT,
    assigned_date DATE,
    return_date DATE
);

CREATE TABLE equipment (
    equipment_id INT PRIMARY KEY,
    equipment_name VARCHAR(255),
    equipment_type VARCHAR(50),
    quantity INT
);

CREATE TABLE instruments (
    instrument_id INT PRIMARY KEY,
    instrument_name VARCHAR(255),
    instrument_type VARCHAR(50),
    quantity INT
);

CREATE TABLE studios (
    studio_id INT PRIMARY KEY,
    studio_name VARCHAR(255),
    location VARCHAR(100),
    owner VARCHAR(255)
);

CREATE TABLE equipment (
    equipment_id SERIAL PRIMARY KEY,
    equipment_name VARCHAR(255) NOT NULL,
    equipment_type VARCHAR(50) NOT NULL,
    quantity INTEGER DEFAULT 0
);

CREATE TABLE studio (
    studio_id SERIAL PRIMARY KEY,
    studio_name VARCHAR(255) NOT NULL,
    location VARCHAR(255),
    owner VARCHAR(100) NOT NULL
);

CREATE TABLE studio_equipment (
    studio_id INTEGER REFERENCES studio(studio_id),
    equipment_id INTEGER REFERENCES equipment(equipment_id),
    quantity INTEGER DEFAULT 0
);

CREATE TABLE studio_instrument (
    studio_id INTEGER REFERENCES studio(studio_id),
    instrument_id INTEGER REFERENCES instrument(instrument_id),
    quantity INTEGER DEFAULT 0
);
